__attribute__((always_inline)) inline double RELU(const double x){ return x > 0 ? x : 0; }

int RunModel(double *input, double *output)
{
    int err = 0;
    _NN_ nn;
    Init_NN(&nn);
    
    err = Test_NN(&nn, input, output);
    if(err) goto error;


    Free_NN(&nn);

    return 0;

error:
    printf("Get something wrong...\n");
    return err;
}
